def custom_histogram(test):
    import string
    freq = {}
    for char in test:
        if char.isalpha() and char in string.punctuation:
            lower_char = char.lower()
            if lower_char not in freq:
                freq[lower_char] = 1
            else:
                freq[lower_char] += 1
    output_freq = {}
    for (key, value) in freq.items():
        output_freq[key + '_' + str(value)] = value
    return output_freq

